import styled from 'styled-components';


export const NavigationBar = styled.nav`
 font-family: 'Lato', sans-serif;
  display: flex;
  flex-direction: row;

  top: 0;
  width: 100%;
  height: 20%;
  .home {
    font-size: 2.5em;
  color: white;
  margin-top: 40px;
  width: 207px; 
  height: 25px; 
  }

  .uList {
    display: flex;
    flex-direction: row;
    justify-content: right;
    
  height: 15%;
  float: right;

  li {
    list-style: none;
  color: white;
  padding: 20px;
  width: 33%;
  }
  }
  
`;





export const SearchLiImage = styled.li`
  padding: 20px;
color: white;
  width: 100px;
  height: 100px;
`;
